INSERT INTO `fiden_social` VALUES ('12030178', '2', 'Porque si', '2', 'Porque si', '0', '2', 'Buena', '2', 'porque si', '2', 'porque si', 'Juagr videojuegos o ver peliculas', 'escuchar musica', 'comprar un terreno y terminar mi titulacion', 'ser un gran ingeniero', 'm m km', 'm m', 'la lcehce el huevo y el poan', 'jnjn', 'jnj');
INSERT INTO `fiden_social` VALUES ('15030171', '3', 'No llevamos muy bien', '3', 'Nos llevamos muy bien', '0', '0', '', '1', 'Nos llevamos bien y me ayudan en mis dudas.', '1', 'Me atienden y nos llevamos bien.', 'Hacer deporte.', 'Los juegos de mesa y sala.', 'Terminar mi carrera.', 'Terminar mi carrera, tener un trabajo y una familia.', 'Una persona muy creativa y alegre que le gusta ayudar a las personas.', 'Alegre', 'Vivir feliz.', 'A ser un buen profesionista y ser humano.', 'No cumpla mis metas personales.');
INSERT INTO `fiden_social` VALUES ('G16030482', '1', 'Pues no he tenido conflictos ni peleas con nadie', '1', 'Aunque aveces no concordamos con todo, nos apoyamos y toleramos', '0', '0', '', '1', 'nos proporcionan la ayuda cunado la requerimos', '1', 'por que la manera en la que manejan la informacion de los alumnos es la correcta y nos atienden cuando lo requerimos', 'dibujar, escuchar musica, etc', 'dibujar', 'terminar la carrera de una manera satisfactoria', 'terminar la carrera y aplicar todo lo que aprendi en el ambito laboral,viajar, etc', 'una persona algo perfeccionista, que trata de ver el lado positivo de las cosas', 'fuerte', 'que cuando se hagan las cosas se hagan bien', 'ser una buena persona, solidaria,etc', 'a fallar en algunas ocaciones');
INSERT INTO `fiden_social` VALUES ('I16030010', '2', 'Todos tenemos intereses diferentes', '3', 'Tenemos cosas en común', '1', '3', 'Buena', '1', 'Hay respeto', '1', 'Hay respeto', 'Correr o leer', 'Lectura y cine', 'Titularme', 'Realización profesional y personal', 'Una persona comprometida con sus metas y sueños, que respeta a todo ser vivo y cuida y ve por su bienestar.', 'Fuerte', 'Las personas sean sinceras', 'Comodidad económica, logros personales y una familia.', 'Me enferme y no logre lo que busco');
INSERT INTO `fiden_social` VALUES ('I16030012', '2', '', '1', '', '0', '0', '', '3', '', '1', '', 'Descansar, preparar postres, pasar tiempo en familia.', 'La repostería.', 'Acreditar el semestre sin pasar nivelaciones.', 'Titularme de la carrera y abrir mi propia resposteria.', 'Una persona amistosa', 'Tranquilo', 'Me tomen en cuenta ante ciertas situaciones.', 'A tener una vida agradable y tranquila, también a tener un trabajo agradable.', 'Pueda llegar a fracasar en mis planes o perder a un familiar');
INSERT INTO `fiden_social` VALUES ('I16030047', '1', 'PORQUE SIEMPRE ESTOY CUANDO ME NECESITAN TRATO DE AYUDAR, SER AMABLE Y AMISTOSA', '1', 'PORQUE ME GUSTA MUCHO CONVIVIR CON ELLOS HACERLOS REÍR', '0', '0', '', '1', 'PORQUE MANTENGO UNA BUENA ACTITUD Y UN BUEN COMPORTAMIENTO HACIA CON ELLOS', '1', 'ME ES INDIFERENTE SIMPLEMENTE TRATO DE SER AMABLE CON TODO MUNDO', 'CONVIVO CON MI FAMILIA, SALGO CON AMIGOS, ME EJERCITO, VEO SERIES, NAVEGO EN MIS REDES SOCIALES.', 'EJERCITARME', 'TERMINAR MI SEMESTRE CON ÉXITO, AMARME A MI MISMA Y ACERCARME MAS A DIOS', 'TENGO MUCHAS PERO CREO QUE LA PRINCIPAL ES CONCLUIR MI CARRERA CON ÉXITO, TITULARME PARA CUMPLIR EL SUEÑO DE MI  FAMILIA Y EL MIO CLARO, SER UNA BUENA INGENIERO Y AYUDAR A LOS DEMÁS.', 'UNA PERSONA MUY OPTIMISTA, AMISTOSA, AGUERRIDA, AMABLE, PACIENTE, PERSISTENTE, AMOROSA, SOLIDARIA, HUMILDE PERO A LA VEZ TENGO MUCHOS MIEDOS Y DEFECTOS COMO TODOS, SOY MUY CHIDA.', 'REGULAR PUES CONSIDERO QUE TENGO MIS MOMENTOS DE IRA Y ENOJO DEPENDIENDO DE LAS SITUACIONES.', 'SEAN HUMILDES Y ME TRATEN Y TRATEN CON RESPETO QUE SEAN PERSONAS MUY TRANSPARENTES HONESTAS Y SINCERAS Y QUE ME APOYEN CUANDO LO NECESITO.', 'SER UNA BUENA PERSONA, ENCONTRAR MI BIENESTAR, MI TRANQUILIDAD, MI FELICIDAD.', 'PERDER A ALGUIEN DE MI FAMILIA QUE FRACASE Y ME RECHASEN QUE NO ME DEN OPORTUNIDADES, QUE NO CONCLUYA MI CARRERA, QUE NO CUMPLA CON MIS OBJETIVOS, TENGO DEMACIADOS MIEDOS.');
INSERT INTO `fiden_social` VALUES ('I16030061', '1', 'Son justos y responsables', '1', 'Es un ambiente agradable y empatico', '1', '3', 'Muy buena es empatica me apoya y me ayuda mucho ya sea desde escucharme hasta echarme la mano con aspectos académicos.', '2', 'Pues aspectos que no creo justos con mi rendimiento académico.', '1', 'Hacen un trabajo bueno y justo', 'Salir a correr o a jugar básquet', 'Componer poesía urbana (rap).', 'Terminar el semestre  sin nivelacines.', 'Pues crear mi propio negocio.', 'Responsable y muy perseverante en lo que quiero', 'Muy duro y firme', 'Todos  sean honestos y sobretodo  muy responsables', 'A ser dueño de mi propio negocio.', 'Pueda caer en alguna situación  médica y frene mis planes.');
INSERT INTO `fiden_social` VALUES ('I16030075', '3', 'SOY MUY SOCIABLE.', '3', 'ME CAEN BIEN JAJA', '1', '3', 'EXISTE RESPETO Y MUCHA CONFIANZA', '3', 'SOY MUY RESPONSABLE Y ESO INFLUYE.', '3', 'MUNCA HE TENIDO ALGUN PROBLEMA', 'ESTAR CON MI FAMILIA, VER A MI NOVIA, HACER DEPORTE, LEER SOBRE MI PROFESIÓN Y ESTAR CON MIS AMIGOS', 'JUGAR FUTBOL', 'TERMINAR MI CARRERA PROFESIONAL', 'OBTENER LOS MEDIOS PARA UNA SATISFACCION LABORAL Y EMOCIONAL EN MI VIDA.', 'UNA PERSONA SEGURA DE SI MISMO, UNA PERSONA COMPROMETIDA DIA CON DIA CON MI SUPERACION PERSONAL.', 'ESTABLE', 'ME RESPETEN, QUE SEAN  HONESTOS  Y SEAN  PERSONAS POSITIVAS.', 'A SER UNA PERSONA DESARROLLADA PROFESIONALMENTE, A TENER UNA FAMILIA ESTABLE Y MANTENERME EN CONSTANTE CRECIEMIENTO LABORAL, ESPIRITUAL Y EMOCIONALMENTE', 'NO SE CUMPLAN MUCHOS DE MIS PLANES DE VIDA');
INSERT INTO `fiden_social` VALUES ('I16030077', '2', 'Por actitudes diversas', '1', 'Difieren de cosas que considero no deberían ser ignoradas', '0', '0', '', '1', 'Resuelven mis dudas', '1', '', 'Leer, escuchar musica, hacer un poco de ejercicio, cantar y ir al cine', 'Cantar', 'Aun no se', 'Son muchas', 'Complicado', 'relajado y un poco enojon', 'las cosas se hagan bien y que cada quien se responsabilice de sus acciones', 'a ser profeionista competente y sabio', 'No ser competente y sabio');
INSERT INTO `fiden_social` VALUES ('I16030084', '1', 'Me llevo con todos mis compañeros, son una excelentes personas y por lo tanto la relación es buena.', '3', 'La razón es por que uno elige a las personas como amigos por que te hacen crecer como persona, aportan cosas positivas a tu vida y considero que elegido a los mejores amigos y mi relación con ellos es la mejor.', '0', '0', '', '2', 'Los profesores con los que he tenido la oportunidad de que me impartan clase por regular siempre me han apoyado tanto en lo académico como en algunas cuestiones personales.', '2', 'La mayoría de veces que he tenido que acudir a las autoridades académicas me han tratado con respeto y muy atentas, así que la relación ha sido regular.', 'Jugar fútbol, escuchar música, salir a caminar, pasar tiempo con mis amigos y familia.', 'Considero que mi actividad seria hacer turismo, siempre me ha gustado hacerlo, me encanta conocer nuevos lugares así que seria una perfecta idea.', 'Concluir la carrera', 'Tener un trabajo estable,  casarme, tener una familia, conocer algunos países.', 'Una persona increíble.', 'Fuerte', 'Las personas que quiero sean felices.', 'A ser feliz en todos los sentidos.', 'No todo me salga como pretendo que sea.');
INSERT INTO `fiden_social` VALUES ('I16030090', '1', 'Porque le hablo a todos', '3', 'Porque me la paso bien con ellos', '1', '3', 'Buena', '1', 'Porque nunca he tenido ningun comflicto', '1', 'Porque respeto sus espacios', 'Practico futbol', 'Jugar futbol', 'Terminar mi carrera', 'Tener una vida estable en todos los sentidos', 'Una persona muy alegra y amigable', 'No soy problematico', 'Me respenten', 'Ser un gran ingeniero', 'No termine mi estudio');
INSERT INTO `fiden_social` VALUES ('I16030096', '1', 'Existe un respeto', '3', 'Hay mucha confianza', '0', '0', '', '1', 'el respeto', '1', 'por la amabilidad', 'Escuchar musica', 'Dibujos', 'Terminar la carrera', 'Tener un hijo, Titularme y ejercer mi profesion', 'Graciela, alegre, inteligente, veraz, imaginativa, simpatica', 'Paciente', 'Todos al rededor este bien', 'A mejorar como persona', 'algun dia me falte mamá');
INSERT INTO `fiden_social` VALUES ('I16030120', '1', 'Son chidos', '3', 'Puedo encajar', '0', '0', '..', '1', 'Son atentos .', '1', 'Hay respeto', 'Ver películas', 'De momento ninguna', 'Emprender', 'Ser exitosa, generar empleo.', 'Soy aquella chica que se preocupa de más y desea enormemente apoyar a la sociedad, además de ser tímida, con propósito y demás.', 'Explosivo pero se está trabajando', 'Me gusta ser amable y educada', 'Estabilidad económica', 'No pueda');
INSERT INTO `fiden_social` VALUES ('I16030127', '2', 'Convivio con la mayoría de ellos sin embargo no comparto algunos comportamientos de algunos.', '1', 'Reímos mucho y los quiero bastante hacemos muchas cosas juntos, sin embargo tengo otros objetivos a diferencia de ellos.', '0', '0', '', '1', 'Existe una buena relación entre alumno-profesor.', '1', 'Sin comentarios', 'Descansar, leer, ver series y películas.', 'Videojuegos, cocinar', 'Titularme', 'Primero trabajar para tener ciertos ingresos, colocar negocios pequeños hasta lograr tener uno más abundante, viajar con mi mamá y hermanos a muchos lugares, tener una hacienda y rancho.', 'Soy una persona de carácter fuerte con objetivos definidos, tímido, aferrado, con muchos miedos pero con ganas de superarlos, se el valor que tengo y soy una persona que protege a quien le es fiel.', 'Me enojo fácilmente.', 'Me gusta que respeten a los animalitos y medio ambiente, existan personas amables.', 'Ser una persona rica con muchos negocios con una estabilidad emocional, tener varios estudios y viajar por muchos lugares.', 'Me vuelvan a lastimar y a morir.');
INSERT INTO `fiden_social` VALUES ('I16030130', '2', 'tenemos diferencias de pensar y actuar.', '1', 'Hemos aprendido a convivir y compartir momentos donde el apoyo es mutuo.', '0', '0', '', '1', 'Consideró que siempre dan lo mejor que tienen para que nosotros aprendamos lo suficiente.', '1', 'Siempre son amables.', 'Escucho música', 'Invertir tiempo con Mi familia', 'Terminar mi carrera y aprender inglés.', 'Ejercer mi profesión en el extranjero.', 'Consideró que siempre trato de dar lo mejor de mi para tener una buena relación con todas las personas.', 'Regular, poco tolerante.', 'Me escuchen y me conozcan antes de juzgarme.', 'Aspirar a algo es como tener un límite y creo que ponerse límites no es correcto debido a que todos tenemos las capacidades de lograr cosas importantes.', 'Algún día pierda a mis padres.');
